Aprovechando las características del lugar y el paisaje que lo compone, en un recorrido de más de 170 metros la pérgola se diseñó a partir de un módulo que se repite y que aprovecha al máximo la optimización de la perfileria metálica y el policarbonato que lo cubre, sobre un concepto volumétrico muy elemental hecho con estructura metálica apoyada por un solo costado por medio de un mástil inclinado con tensores de soporte del voladizo de la cubierta de la pérgola con dados de concreto para mejorar las condiciones estructurales dadas las fuertes corrientes de viento que producen un empuje y un carga sobre el plano inclinado.

El diseño se hizo con el objetivo de aprovechar permanentemente el recorrido mirando hacia las áreas verdes y el campo de futbol haciendo un paseo más amigable dada la distancia a recorrer.

